import React from 'react';

const ReviewItem = (props) => {
    console.log(props);
    const {name,quantity,img}= props.product;
    return (
        <div>
            <div>
            <img className='product-img' src={img}/>

            </div>

            <div>
            <h4 className='product-name'>{name}</h4>
            <p>Quantity: {quantity}</p>
       
            </div>
             </div>
    );
};

export default ReviewItem;
